import React from 'react';

const Help = () => {
  return (
    <div>
      <h2>Help</h2>
      <p>
        Welcome to our Car Rental Help page! If you have any questions or need assistance, please refer to the
        information below.
      </p>
      <h3>Frequently Asked Questions (FAQ)</h3>
      <ul>
        <li>Q: How can I book a car?</li>
        <li>A: To book a car, please navigate to our Booking page and follow the instructions provided.</li>
        <br />
        <li>Q: Can I cancel my reservation?</li>
        <li>A: Yes, you can cancel your reservation. Please go to the My Reservations page and follow the cancellation
          process.</li>
        <br />
        <li>Q: How do I contact customer support?</li>
        <li>A: You can reach our customer support team by calling our toll-free number 1-800-123-4567 or by sending an
          email to support@carrental.com.</li>
      </ul>
    </div>
  );
};

export default Help;
